import { AuthContext } from "../contexts/AuthContext";
import { useContext } from "react";

const PageNotFound= () =>{

	const { userAuth } = useContext(AuthContext);
	return (
		<div>
        	<h1>404 Error</h1>
        	<h1>Page Not Found</h1>
			<p>{userAuth.username}</p>
    	</div>
	);
}

export default PageNotFound;
